import React, { useEffect, useState } from "react";
import { FullpageSection } from "@ap.cx/react-fullpage";
import html5 from "../../img/html5.png";

const HomeConts3 = () => {
  const profileData = [
    { name: "TITLE :", text: "포터 코리아 홈페이지" },
    { name: "DATE :", text: "2023. 04 ~ 2023. 05" },
    { name: "SKILLS :", text: "HTML, CSS, JS" },
    // { name: "MAIL :", text: "kws04182@gmail.com" },
  ];

  return (
    <FullpageSection>
      <div className={`homeWrapper3 homeBg`}>
        <div className="textWrapperRight">
          <div className="WrapperRightCon">
            <h1 className="typedText">PROJECTS</h1>
            <p>{profileData[0]}</p>
            <p>저는 원래 토목과를 전공하였는데요.</p>
            <p>우연한 기회로 웹디자인과 프로그래밍 기초언어를 접하게 되었고,</p>
            <p>컴퓨터 공학에 관심을 갖게 되었습니다.</p>
            <p>개발을 공부하다보니 많은 사람들이 애용하는 서비스를</p>
            <p>직접 개발하고 싶다는 생각을 하게 되었고,</p>
            <p>자연스럽게 프론트엔드 개발자를 꿈꾸게 되었습니다.</p>
          </div>
          <div className="WrapperRightCon2"></div>
        </div>
        <div className="textWrapperLeft">
          <div className="projectBg"></div>
        </div>
      </div>
    </FullpageSection>
  );
};

export default HomeConts3;
